import React, { useState, useEffect } from 'react';
import { useHistory } from 'react-router-dom';

export default function ShowPlaylist(props) {
    const [playlists, setPlaylists] = useState([]);
    const history = useHistory();

    useEffect(() => {
        const fetchPlaylists = async () => {
            try {
                const response = await fetch(`http://localhost:5000/fetchPlaylist/${props.email}`);

                if (!response.ok) {
                    throw new Error('Failed to fetch playlists');
                }

                const data = await response.json();
                setPlaylists(data.playlistName);
            } catch (error) {
                console.error('Error fetching playlists:', error);
            }
        };

        fetchPlaylists();
    }, [props.email]);

    const handleClick = (playlistId) => {
        history.push(`/playlist/${playlistId}`);
    };

    return (
        <div>
            {playlists.map(playlistId => (
                <button key={playlistId} onClick={() => handleClick(playlistId)}>
                    {playlistId}
                </button>
            ))}
        </div>
    );
}
